('id', '_template', 'atutor_accessibility_text', '<p>ATutor memiliki berbagai macam fitur yang menjamin bahwa materi dapat di akses oleh semua pengguna, meliputi pengguna dengan akses internet yang lambat, web brouwser lama, dan pengguna dengan dengan keterbatasan penganeksesan internet. Fitur-fitur akan diuraikan sebagai berikut.</p> <ol> <li><b>Jala pintas Links:</b> Pada bagian atas kiri ATutor ada sejumlah jalan pintas Links yang tersembunyi  yang memungkinkan pengguna langsung ke bagian navigasi dan langsung menuju ke bagian isi materi. Tekan tombol Tab setelang suatu halaman selesai ditamplikan dan kembali ke jalan pintas link pertama  kemudian tekan Enter untuk kembali ke materi bagian atas. Cara lain, pengguna dapat menekan tombol Tab dua kali,  kemudian Enter untuk lengsung ke menu bagian atas. Tekan tombol Tab yang ke tiga langsung ke Tab pertama (Depan) pada bar navigasi utama. Tekan tombol Tab ke 4 langsung ke halaman ini untuk informasi konfigurasi pada ATutor untuk efektifitas fungsi ATutor.<br /><br /> [Baru pada in V1.3]  <strong>Menu Bypass</strong> link adalah tersusun secara dinamik dan tertuju pada posisi anda terakhir pada daftar menu. Untuk menemukan jalan kembali anda ke daftar menu sesudah membuka atau menutup suatu item, tab ke kalaman sesudahnya sampai loading berakhir dan mencapai link Menu Bypass, kemudian tekan enter dan langsung ke item menu yg saat ini aktif. </li> <li><b>Default Accessibility Preference Configuration:</b> ATutor mempunyai akses configurasi dasar yang tersembunyi untuk semua simbul yang tidak utama dan alat navibasi yang ketika aktif <b>Selama pendaftaran</b> pilih \"Enable the Accessibility preferences scheme\" untuk seting akses ketika masuk ke ATutor. Penghilangan hampir semua simbul dari ATutor dan menutup Menu, meninggalkan  sequen link sebagai navigasi utama.\r\nKonfigurasi aksesbiliti ATUtor dapat juga di pilih pada <b>Preset Preference</b> \"<a href=\"tools/preferences.php?pref_id=1\">Accessibility</a>\" pada bagian atas halaman preference.\r\n\r\n Screen reader users are advised to begin with this default preference setting and then modify those settings later through the Preferences page (if necessary).</li> <li><b>Accesskeys:</b> Keyboard accessibility has been added to many ATutor features. To activate accesskeys, press Alt plus the assigned number or letter as follows: <ul> <li>[Alt 1] Home</li> <li>[Alt 2] Tools</li> <li>[Alt 3] Resources</li> <li>[Alt 4] Discussions</li> <li>[Alt 5] Help</li> <li>[Alt 6] Toggle menus open and closed</li> <li>[Alt 7] Global Menu</li> <li>[Alt 8] Previous topic</li> <li>[Alt 9] Next topic</li> <li>[Alt 0] Resume</li> <li>[Alt y] Main Navigation</li> <li>[Alt m] Menus</li> <li>[Alt j] Jump Menu</li> <li>[Alt s] Submit (active on form pages)</li> <li>[Alt c] Jump to content top (top and bypass link)</li> </ul> <p>Content Editor AccessKeys</p> <ul> <li>[Alt n] Content Tab</li> <li>[Alt p] Properties Tab</li> <li>[Alt k] Keywords Tab</li> <li>[Alt g] Glossary Tab</li> <li>[Alt r] Preview Tab</li> </ul> <p>Chat AccessKeys</p> <ul> <li>[Alt c] Jump to Compose Message field</li> <li>[Alt r] Refresh Messages</li> <li>[Alt m] Jump to Message List</li> <li>[Alt q] Open Chat Help</li> </ul> </li> <li><b>Alternative Text:</b> All images in ATutor include a text alternative that describes the image or its function.</li> <li><b>Alternative Navigation:</b> Global, hierarchical, and sequential navigation tools are available so users can view or structure content in a manner that suits their style of learning. See the Help pages or the ATutor HowTo course for more information about ATutor\'s navigation features.</li> <li><b>Hide Menus:</b> For users of older assistive technologies that do not support columnar text laid out in tables, it is possible to hide ATutor\'s menus so that content will be displayed in a linear presentation. Hiding menus also conserves space for users with smaller monitors.</li> <li><b>Text or Images:</b> ATutor users can choose to have navigational features displayed as either text, icons, or text and icons through a variety of preference settings.</li> <li><b>Form Labels:</b> All form fields throughout ATutor are marked up using the LABEL element to ensure that they are properly described for assistive technology users. Explicit labelling in this manner also makes it possible to click on a form field\'s label to activate the field. This provides a larger target area for those people who have difficulty positioning a mouse pointer on a small form field such as a radio button or a checkbox.</li> <li><b>Style Sheets:</b> Wherever possible, the presentation of content in ATutor is controlled by style sheet elements. This allows users to override ATutor\'s default appearance and apply their own preferred presentation styles (i.e. increased font sizes, different font styles, colours, etc.) </li> <li><b>Form Field Focus:</b> For pages where the primary content is a form, the mouse cursor will automatically be placed in the first field so that after a form page loads, it is not necessary to click or Tab into a field. Rather, users can begin typing text into the form as soon as the page has finished loading.</li> <li><b>Relative Sizing of Images:</b> [New in V1.3] With browsers that support resizing of images, ATutor icons can be magnified for user with low vision, making them more easily visible. (e.g. Netscape 7 press Alt +) </li> </ol>', '2004-06-13 05:06:38', ''),
('id', '_template', 'atutor_home', 'Halaman depan ATutor', '2004-04-17 01:28:16', ''),
('id', '_template', 'atutor_is', '<strong><em>ATutor</em></strong> is an Open Source Web-based <strong>Learning Content Management System (LCMS)</strong> didisain dengan berbagai kemudahan  dan penyesuaian penggunaan. Administrators daoat menginstall dan mengupgrade hanya dalam beberapa menit. Dosen pengajar dapat secara cepat menyusun, mengemas dan mendistribusikan petunjuk dan materi kuliah,  serta melaksanakan kulia on line. Mahasiswa dapat belajar dalam lingkungan yang adaptif.', '2004-04-17 01:47:27', ''),
('id', '_template', 'atutor_links', '<p>Lebih lanjut tentang <a href=\"http://atutor.ca/index.php\">ATutor</a> dengan menjelajahi link-link berikut:</p> <ul> <li><a href=\"http://www.atutor.ca/howto.php\">ATutor <em>HowTo</em> Course</a> -Belajar menggunakan petunjuk-petunjuk dalam penggunaan ATutor</li> <li><a href=\"http://atutor.ca/atutor/docs/index.php\">FAQs</a> - Permsalaahn yang sering muncul dan penyelesaiaanya</li> <li><a href=\"http://atutor.ca/forums/index.php\">Support Forums</a> - Kirim ke pengguna ATutor yang lain </li> <li><a href=\"http://atutor.ca/services/index.php\">Support Services</a> - Tersedia juga bantuan petunjuk dan dukungan penggunaak</li> <li><a href=\"http://atutor.ca/atutor/translate/index.php\">Translation</a> - Muat turun paket bahas, mejandi penerjemah</li> <li><a href=\"http://atutor.ca/services/licensing.php\">Licensing</a> - Perangkat lunak ATutor ini tersedia gratis dengan konsekuensi tertentu</li> <li><a href=\"http://atutor.ca/atutor/download.php\">Muat turun ATutor</a> - Semua sistem perangkat lunak yang diperlukan ATutor dapat diperoleh di sini</li> </ul>', '2004-04-17 01:55:50', ''),
