('id', '_template', 'chat_help_display_blurb', '<p>Catatan: <em>Langsung ke</em> link dan <em>Jalan pintas</em> yang hanya dapat anda lihat jika anda mengaktifkan <em>Petunjuk Navigasi</em> pada tampilan anda.</p> <ul> <li><em>Kunci Jalan Pintas</em> link di atas yang akan menghantar anda langsung ke jalan pintas Chat. </li> <li><em>Ruang Pesan</em> menampilkan pesan terakhir (sampai 10 pesan terakhir). </li> <li> <em>Jalan pintas ke link pesan</em>  yang membawa anad ke daftar pesan. (Alt+M+Enter) </li> <li>The <em>Refresh Messages</em> link untuk melihat adanya pesan baru (Alt+R+Enter). </li> <li>The <em>Tulis Message</em> Ruang dan <em>Tombol Kirim</em> memungkinakan anda kirim pesan (Alt+C masuk ke runag, Enter untuk mengirim pesan). </li> </ul>', '2004-04-18 03:50:27', ''),
